import FieldAgents from "./components/FieldAgents";

function App() {
  return (
    <div className="App">
      {init ? 
      (<AuthContext.Provider value={authManager} >
        <NavBar />
        <div className="container">
          <Switch>
            {/* base routing */}
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/about">
              <About />
            </Route>

            {/* todo routing */}
            <Route exact path="/todo" >
              {/* this is fine to leave open */}
              <ToDos />
            </Route>
            {/* edit or delete or add should not be publicly available */}
            <Route path="/todo/add" >
              {authManager.user ? <AddToDo /> : <Redirect to="/login" /> }
            </Route>
            <Route path="/todo/edit/:todoId" >
              {authManager.user ? <UpdateToDo />  : <Redirect to="/login" /> }
            </Route>
            <Route path="/todo/delete/:todoId" >
              {authManager.hasRole('admin') ? <DeleteToDo />  : <Redirect to="/login" /> }
            </Route>
            <Route path="/login" >
              {authManager.user ? <Redirect to="/" /> : <Login />}
            </Route>
            <Route path="/register" >
              {authManager.user ? <Redirect to="/" /> : <Registration />}
            </Route>
            <Route>
              <NotFound />
            </Route>
          </Switch>   
        </div>
      </AuthContext.Provider>) : null}
    </div>
  );
}

export default App;
